import React from 'react'

const Profile = () =>
{
    return (
        <div>
            <button className="delete__avatar">Удалить аватар</button>
            <input type="file" className="upload__avatar" placeholder='Загрузить аватар'/>
        </div>
    )
}
export default Profile;
